import client1 from "../img/client1.jpg";
import client2 from "../img/client2.jpg";
import { Star } from "../icons/stars";

const Review = () => {
  return (
    <div className="reviewWraper">
      <div className="upper">
        <img src={client1} alt=" client1" />
        <div className="stars">
          <Star />
          <Star />
          <Star />
          <Star />
          <Star />
        </div>
      </div>
    </div>
  );
};

export default Review;
